CREATE DEFINER=`root`@`localhost` PROCEDURE `procInitAttrKeyValues`()
begin
	-- 局部变量与会话变量 
	declare i int default 0;
    declare j int default 0;
    
    declare len int default 0;
    declare flag int default 0;
    declare goods_id int;
    
    
